import React from "react";

const article_1 = () => {
	return {
		date: "7 May 2023",
		title: "AWS Certified Cloud Practitioner",
		description:
			"This certification covers the foundational understanding of AWS cloud concepts, security, pricing, and architecture. It includes core cloud principles and various AWS services in compute, storage, databases, and networking, encompassing over 90 services in total.",
		keywords: [
			"The Benefits of Cloud Computing",
			"Chris",
			"Chris N",
			"Chris Noble",
		],
		style: `
				.article-content {
					display: flex;
					flex-direction: column;
					align-items: center;
				}

				.randImage {
					align-self: center;
					outline: 2px solid red;
				}
				`,
		body: (
			<React.Fragment>
				<div className="article-content">
					<div className="paragraph">Content of article 1</div>
					<img
						src="https://picsum.photos/200/300"
						alt="random"
						className="randImage"
					/>
				</div>
			</React.Fragment>
		),
	};
}

const article_2 = () => {
	return {
		date: "7 May 2023",
		title: "Professional Scrum Master",
		description:
			"AI is transforming the healthcare industry, from improving patient outcomes to streamlining operations. Discover the latest applications of this game-changing technology.",
		style: ``,
		keywords: [
			"Artificial Intelligence in Healthcare",
			"Chris",
			"Chris N",
			"Chris Noble",
		],
		body: (
			<React.Fragment>
				<h1>Content of article 2</h1>
			</React.Fragment>
		),
	};
}

const myArticles = [article_1, article_2];

export default myArticles;
